import './nav2.css';
import { Link } from "react-router-dom";

export default function Nav2() {
    return (
        <div className="nav-nav">
            <img className="logo" src='../assets/logo.png' alt='logo'/>
            
            <ul className="rightsection">
           
                        
                        <li> <Link to="/winnersgallery" style={{ color: "white"}}>Winners Gallery</Link></li>
                   
            <li>City Talks</li>
            <li><Link to="/sponsership" style={{ color: "white"}}>Sponsership</Link></li>
              
            </ul>
        </div>
    );
}
